INSERT INTO `t_article` VALUES (3024, 'The Line of Least Resistance', 'https://newonebucket.oss-cn-hongkong.aliyuncs.com/english-learing-app/2023/12/12/46e8f8e0336e40888d439d3e8c91d095.jpg', 'Our story today is called \"The Line of Least Resistance.” It was written by Edith Wharton. Here is Larry West with the story.', '2023-12-12 10:42:25', '2023-12-12 10:42:25', 0, 234);
INSERT INTO `t_article_content` VALUES (3002, 3007, 'Mushrooms are not only tasty. They are also filled with healthy nutrients, like calcium and potassium, and vitamins, like D and B.\n\nSome people not only enjoy eating mushrooms. They also like to collect them in the wild. But that is not for everyone. While some people are knowledgeable enough to collect mushrooms in the woods and eat them, many people are not. Eating the wrong mushroom can make you sick or even … dead.\n\nTherefore, buying them is the easier and safer choice. However, there is another one: You can grow mushrooms yourself inside your own home.\n\nIn a recent article for The Associated Press, plant expert Jessica Damiano explains there are two ways to do this. You can buy a set of materials from a garden store called a “grow kit” or you can put them together yourself.\n\nGrow kits\n\nGrow kits are a great way for beginners to try growing mushrooms. These grow kits include partly-grown mushroom starters, called “spawn.” The spawn is set in soil and is contained in its own grow box. You put the spawn in water overnight. Then you return it to the box and open it to fresh air. Spray it with water two times a day.\n\nWithin two or three weeks, you will be eating mushrooms with more on the way. Damiano says it is a fun, easy activity. And people will likely ask you about it.\nPutting them together yourself\n\nIf you are more serious about growing mushrooms and want a larger harvest, Damiano says it costs less to put the materials together yourself. It is easy, she says.\n\nFor starters, you will need a wooden, metal, or plastic box or container. It needs to be about 15 centimeters deep and large enough to hold your harvest.\n\nYou will also need a growing substance -- soil mixed with compost and other materials. The materials depend on the mushrooms. White button mushrooms grow better in a half-and-half mix of compost and well-rotted manure. Oyster mushrooms do well in oat or wheat straw. Shiitakes, another kind of mushroom, like sawdust.\n\nFinally, you will need fungal spores: Think of them as seeds. You can purchase these online or at specialty stores.\n\nClean your hands well. Avoid bringing bacteria, mold, or non-mushroom fungi into the box. Fill the box with your growing substance (soil and materials) leaving about 25 millimeters at the top. Put the spores evenly over the soil substance and gently wet it. Spray it with water twice daily. Keep it wet but not too wet.\n\nTo grow quickly and effectively, the spore-topped soil material should be kept away from direct sunlight. It should be kept at or close to 21 degrees Celsius. If you cannot keep a room in your home at that temperature, set the box or tray on a heating pad set to 21 degrees but no higher (warmer temperatures can kill the spores). A soil thermometer can help make sure the soil does not get too warm.\n\nPut a piece of cloth lightly over the top of the box to keep moisture in. But do not seal it tightly.\n\nSoon, a white coating will form on the surface of the soil. That is mycelium, a network of fungal threads from which your mushrooms will grow.\n\nWhen the soil is completely coated with mycelium, top it off with a bit more of the soil mixture. Remove any heating elements. And move the tray to a cooler spot – 12 to 15 degrees Celsius.\n\nMushrooms usually grow, or “fruit,” within a week or two. They nearly double in size daily until they are finished growing. Depending on the kind of mushroom, they will be ready to harvest, with their tops fully open. That will be in roughly three to four weeks. Use a sharp, clean knife to cut them at soil level to avoid disrupting nearby growth.\n\nI’m Anna Matteo.\n\nJessica Damiano reported this story for the Associated Press. Anna Matteo adapted it for VOA Learning English.');
INSERT INTO `t_article_content` VALUES (3003, 3008, 'High school students in the United States can earn college credits by taking and passing Advanced Placement (AP) courses. The classes, developed by The College Board, cover many subjects, including English, history, math, and sciences among others.\n\nThis week, the non-profit organization released a new set of ideas and skills, called a framework, for its AP African American Studies course. The latest version comes months after the organization was criticized for discussing course requirements with conservative critics.\n\nChanges include more attention to ideas such as the Tulsa Race Massacre, Black culture’s influence on film and sports, and discrimination in housing, known as redlining. The latest version will be used when the class officially launches at the start of the next school year.\n\nThe AP African American History course gained national attention earlier this year. At that time, Florida Governor Ron DeSantis, currently a Republican presidential candidate, said he would ban the course in his state because it pushed political issues. Florida released a list of concerns it had with the pilot, an early version of a course.\n\nIn February, the College Board released its first official version of the AP course. It did not contain several subjects on the list of Florida’s concerns, including Black Lives Matter, slavery reparations and several important Black writers.\n\nThe board was then widely criticized for giving in to political pressure. The new changes pay attention to some of that criticism.\n\nChanges in the latest version\n\nThe latest version includes several important Black writers that were excluded, and written works about feminism and intersectionality. Intersectionality is the idea that race, gender, and class combine to create different levels of discrimination and privilege in society.\n\nThe College Board did not add back every subject that was removed earlier. The Black Lives Matter movement is still not included in the final test for the course. However, it is mentioned along with other examples and listed among subjects that schools could choose from for further discussion.\n\nNelva Williams is a member of the course’s development committee. She has been a teacher for more than 40 years. She also taught a pilot class of AP African American Studies in Houston, Texas.\n\nWilliams said, “The updates are based on teacher recommendations, and changes coincide with the latest scholarship and resources used at the collegiate level.”\n\nRashad Shabazz teaches several courses related to race at Arizona State University. He said the course provides students with the basics to understand the field of African-American studies. But it does not contain in-depth theoretical discussions that are more common at the college level.\n\nNext year, the AP course will be available to all schools in the U.S. But it remains unclear how many will offer it. Holly Stepp, a spokesperson for the College Board, said they are pleased with the interest that has been expressed in the course.\n\nI’m Gena Bennett.\n\nCheyanne Mumphrey reported this story for the Associated Press. Gena Bennett adapted it for VOA Learning English.');
INSERT INTO `t_article_content` VALUES (3004, 3009, 'Question:\n\nHello VOA Ask a Teacher,\n\nI am Lyla from China. I am confused about “ability” and “capability.” I looked them up in the dictionary, but I still can\'t tell them apart.\n\nCan you explain the difference?\n\nThanks, and best regards,\n\nLyla\n\nAnswer\n\nThanks for your question, Lyla. The words are so similar that their use can even trouble native English speakers! Generally, ability describes special skills and qualities now in use. “Capability” speaks more to the possible power or use of those skills and qualities.\n\nLet’s take a closer look at each.\n\nAbility\n\n“Ability” is a noun that comes from the adjective “able.” If you are “able,” you can do something. You can carry out an action. “Ability” means a quality, skill, or aptitude that you have that makes it possible for you to do something. Compare these sentences:\n\nI have the ability to speak Russian and English.\n\nCourtney’s disabilities are the result of a car accident.\n\nHenry’s cooking abilities increased over years of practice in his own home.\n\nLet’s move onto “capability.”\n\nCapability\n\n“Capability” is the quality or state of being capable. “To be capable” means having qualities or skills to successfully perform some future action. Your “capability” depends more on the situation, environment, or your desire to do something rather than just your ability to do it.\n\nHe has the capability of lifting very heavy weights, but he injured himself last year, so he chooses to lift light weights while he recovers.\n\n“Capability” also can mean a skill set that can be further developed.\n\nThe new employees have strong capabilities in marketing. They just need more experience in the business world.\n\nFinally, “capability” is the possibility to be affected by use or treatment.');
INSERT INTO `t_article_content` VALUES (3005, 3010, 'Everyone expected Japan’s Shohei Ohtani to receive the biggest deal in baseball history. Over the weekend, the two-time Most Valuable Player award-winner received the biggest deal in team sports history.\n\nOn Saturday, the Japanese star announced that he had agreed to a 10-year contract with the Los Angeles Dodgers valued at $700 million.\n\nOlympics.com says the amount is higher than the $679 million for France’s Kylian Mbappe with Paris Saint-Germain in 2022, $674 million for Lionel Messi with Barcelona in 2017, and Cristiano Ronaldo’s $500 million agreement with Al Nassr.\n\nThe total is also higher than the largest American football contract of $450 million given to Patrick Mahomes of the Kansas City Chiefs. It far exceeds the baseball deals of $426.5 million given to Mike Trout of the Los Angeles Angels and the $360 million given to Aaron Judge of the New York Yankees.\n\nUnder the contract, Ohtani’s average yearly salary of $70 million is well above the previous high of about $43 million that pitchers Max Scherzer and Justin Verlander struck with the New York Mets. His average yearly salary is also higher than the combined salary of all players with the Baltimore Orioles or the Oakland A’s this year.\n\nOhtani’s agent, Nez Balelo, called it “a unique, historic contract for a unique, historic player.” Another sports agent, Leigh Steinberg said, “He’s rocketed into a stratosphere all his own.”');
INSERT INTO `t_article_content` VALUES (3006, 3011, 'Four years ago, country music star Brad Paisley and his wife, actress Kimberly Williams-Paisley, helped create a free food store in Nashville, Tennessee. Their goal was to give families in need the ability to choose their own food in a place that felt like a normal store. They named it The Store.\n\nThe Store is a partnership with Nashville’s Belmont University, where Paisley earned his degree.\n\nThe Store is turning into a free toy store ahead of the Christmas holiday. The event began Friday. For two days, chosen families could pick out new toys, video games, stuffed animals, makeup and other gifts.\n\nPaisley said, “The emotional aspect of being able to give your child something your child wanted versus just something to sort of get you through the holidays…that’s such a load off the minds of somebody who maybe didn’t think they were going to be able to do that.”\n\nPaisley and Williams-Paisley brought the idea of a free food store to Nashville after seeing a similar effort in California. The Store launched in early 2020. Its opening came just weeks after a powerful tornado hit the area and shortly before the start of the COVID-19 pandemic. The pandemic made food access an urgent problem.');
INSERT INTO `t_article_content` VALUES (3007, 3012, 'Many observers expected a long legal fight between the two sides. Some did not believe the mine would ever open.\n\nBut the Eagle mine has been open for more than 10 years. There have been no accidents or pollution problems.\n\nPeople in the area who once protested the mine have found a way to exist with the mine.\n\nMaura Davenport is one of those people. She is one of the top leaders of the Superior Watershed Partnership (SWP), an environmental interest group.\n\n“I was fiercely opposed to the mine, and I changed,” she said.\n\nDavenport’s group was invited to act as a “watchdog” for the mine. Rio Tinto asked the group to oversee pollution testing that has higher standards than regulators require.\n\nThe cooperation between the environmental group and the mining company may be an example for other mines around the world.\n\nMany new mines are opening in order to provide minerals needed to make items used by the green energy economy. These items include batteries, electrical wire and magnets.\n\nIf countries around the world are to meet the climate goals set in Paris in 2015, there needs to be a 400-percent increase in the production of these minerals. The International Energy Agency said there needs to be an increase of 19 times in nickel production alone.\n\nDavenport said the Eagle mine proposal “divided our community.” Other mines in northern Michigan had opened in the 1800s and closed in the 1930s. The mining companies left behind large open holes and environmental damage. Water that ran from the mine polluted Lake Superior, one of the Great Lakes in the northern Midwest.');
INSERT INTO `t_article_content` VALUES (3008, 3013, 'Technology leaders have shown major support for laws to govern artificial intelligence use. At the same time, they are seeking to guarantee that any future AI rules work in their favor.\n\nThe technology industry is increasingly divided about how to govern AI. One side supports an “open science” method to AI development; the other supports a closed method.\n\nFacebook parent Meta and IBM recently launched a new group called the AI Alliance. The group supports the “open science” method of AI development. On the other side are companies such as Google, Microsoft and ChatGPT-maker OpenAI.\n\nSafety is at the heart of the debate. But, tech leaders are also arguing about who should profit from AI developments.\n\nWhat is open-source AI?\n\nThe term “open-source” comes from a common method of building software in which the code is widely available at no cost. Anyone can examine and make changes to it.\n\nOpen-source AI involves more than just code. Computer scientists differ on how to define \"open source.” They say the identifications are dependent on which parts of the technology are publicly available and if there are restrictions on use.\n\nSome computer scientists use the term “open science” to describe the wider philosophy.\n\nIBM and Meta lead the AI Alliance. Members include Dell, Sony, chipmakers AMD and Intel, and several universities and smaller AI companies. The alliance is coming together to say “that the future of AI is going to be built ... on top of the open scientific exchange of ideas and on open innovation, including open source and open technologies,” said Darío Gil of IBM. Gil made the comment in a discussion with The Associated Press.\n\nConcerns about open-source AI\n\nPart of the confusion about open-source AI is that the company that built ChatGPT and the image-generator DALL-E is called OpenAI. But its AI systems are closed.\n\n“There are near-term and commercial incentives against open source,” said Ilya Sutskever, OpenAI’s chief scientist and co-founder, in a video with Stanford University in April.\n\nBut there is also a longer-term worry about the open development method. Sutskever noted one worry is that an AI system with powerful abilities could be too dangerous to make available to the public.\n\nFor example, he described a possible AI system that could learn how to start its own biological laboratory.\n\nEven current AI models present risks. They could create disinformation campaigns, for example, said David Evan Harris of the University of California, Berkeley. Such campaigns could disrupt democratic elections, he said.\n\n“Open source is really great in so many dimensions of technology,” but AI is different, Harris said.\n\nThe Center for Humane Technology, a longtime critic of Meta’s social media activities, is among the groups drawing attention to the risks of open-source or leaked AI models.\n\n“As long as there are no guardrails in place right now, it’s just completely irresponsible to be deploying these models to the public,” said the group’s Camille Carlton.\n\nBenefits and dangers\n\nAn increasingly public debate has appeared over the good and bad of using an open-source method to AI development.\n\nMeta’s chief AI scientist, Yann LeCun, this fall criticized OpenAI, Google, and Anthropic on social media for what he described as “massive corporate lobbying.” Le Cun argues that the companies are trying to write rules in a way that help their high-performing AI models and could help them hold their power over the technology’s development. The three companies, along with OpenAI’s key partner Microsoft, have formed their own industry group called the Frontier Model Forum.\n\nLeCun said on X, formerly Twitter, “Openness is the only way to make AI platforms reflect the entirety of human knowledge and culture.”\n\nFor IBM, the dispute feeds into a much longer competition that began before the AI boom. IBM was an early supporter of the open-source Linux operating system in the 1990s.\n\nChris Padilla leads IBM’s international government affairs team. The companies are trying to raise fear about open-source innovation as they have in the past, he suggested.\n\nHe added, “I mean, this has been the Microsoft model for decades, right? They always opposed open-source programs that could compete with Windows or Office. They’re taking a similar approach here.”\n\nI’m John Russell.\n\nMatt O’Brien reported on this story for the Associated Press. John Russell adapted it for VOA Learning English.');
INSERT INTO `t_article_content` VALUES (3009, 3014, 'Officials in the American city of Detroit, Michigan, have equipped a piece of road with technology designed to charge electric vehicles (EVs) on the path.\n\nThe roadway is meant to serve as a demonstration project for the technology, which could be expanded to larger road systems. Leaders of the project say it is believed to be the country’s first public wireless charging roadway built for EVs.\n\nThe system uses a series of copper wires placed underneath the road. These wires have the ability to send electricity through a magnetic field to charge an EV’s battery. Charging can happen while the car is driving or sitting above the equipment.\n\nThe technology was created by an Israeli company called Electreon, a developer of wireless charging solutions for EVs. The company currently has contracts to build similar roadways in Israel, Sweden, Italy and Germany.\n\nStefan Tongur is Electreon’s vice president of business development. He told The Associated Press EVs require special equipment to receive the wireless signal. “The technology is smart,\" Tongur said, and “knows who you are…”');
INSERT INTO `t_article_content` VALUES (3010, 3015, 'European Union scientists said on Wednesday that 2023 would be the warmest year on record. The average world temperature for the first 11 months of the year hit the highest level on record, 1.46 degrees Celsius above the 1850 to 1900 average.\n\nThe record comes as governments are in negotiations at the COP28 meeting in Dubai. Governments are deciding whether to gradually stop the use of coal, oil and gas, the main source of warming emissions.\n\nThe temperature for the January to November period was 0.13 degrees higher than the average for the same period in 2016, currently the warmest calendar year on record. That information comes from the Copernicus Climate Change Service (C3S).\n\nNovember 2023 was the warmest November on record worldwide. The average surface air temperature was 14.22 degrees, 0.85 degrees above the 1991 to 2020 average for November. It was 0.32 degrees above the previous warmest November, in 2020, C3S added.\n\nSamantha Burgess is deputy director of C3S. She said in a statement that the “November temperatures, including two days warmer than 2C above preindustrial, mean that 2023 is the warmest year in recorded history.”\nThe autumn in the Northern Hemisphere from September to November was also the warmest on record by a large amount. The average temperature was 15.3 degrees, 0.88 degrees above average, EU scientists said.\n\nThe 2015 Paris climate agreement set a goal of limiting worldwide temperature rise to 1.5 degrees above pre-industrial times. Above that limit, scientists warn of severe effects on weather, health and agriculture.');
INSERT INTO `t_article_content` VALUES (3011, 3016, 'Lucy was rescued from a rural property in New South Wales, Australia, two years ago. She was suffering from chlamydia, a disease widespread among koalas.\n\nToday, she is one of the lucky animals living in tree corridors that have been created to protect koalas and other animals by saving their quickly shrinking habitat, or natural environment.\n\nThe corridors, planted by the local conservation group Bangalow Koalas, are made up of large systems of plants. They are a lifeline for koalas and other animals like the glossy black cockatoo, gliders, possums, and wallabies. All of them are endangered, or at risk of becoming extinct.\n\nThe corridors provide a safe path across the koala\'s increasingly broken habitat. This permits increased genetic mixing and protection from human threats.\n\n\"Our corridors are actually trying to get them away from humans, from cars, from dogs,\" said Linda Sparrow, president of Bangalow Koalas. \"They can safely move across the landscape and not have to put up with us humans.\"\n\nThe koala is predicted to be extinct in the wild in New South Wales by 2050. Some of the biggest threats include wildfires and habitat loss through land clearing for development. Koalas have already been declared endangered in several Australian states.\n\nFounded in 2019, Bangalow Koalas has planted over 336,000 trees on 119 properties, helping koala conservation and improving the local ecosystem. The group, which depends on community volunteers, aims to plant 500,000 trees by 2025.\n\n\"The neighbor would want to join and then another neighbor will want to join,\" Sparrow said, describing increasing the number of people involved in the corridor.\n\nVolunteer Lindy Stacker, who has been planting trees for over five years, said the activity is good for mental health and has brought the community together.\n\nA recent report by the Australian Koala Foundation said the animal was worth an estimated $3.2 billion per year to the tourism industry.\n\nHowever, the World Wildlife Fund-Australia reported concerning declines in koala populations in Australian states, with a 50 percent drop in Queensland and a 62 percent drop in New South Wales since 2001.\n\nSparrow remains committed to the cause.\n\n\"I can\'t imagine a world where there\'s no koalas in the wild,\" she said.\n\n\"We\'re going to do everything we can possibly to make sure that doesn\'t happen.\"\n\nI’m Gena Bennett.\n\nJill Gralow reported this story for Reuters. Gena Bennett adapted it for VOA Learning English.');
INSERT INTO `t_article_content` VALUES (3012, 3017, 'Almost all new parents struggle to get enough sleep while caring for their newborns. For some penguin parents, though, periods of sleep are especially short.\n\nPenguins are birds that cannot fly but use their wings for swimming. They live in or near the Antarctic.\n\nResearchers recently found that Chinstrap penguins only sleep for about four seconds at a time in order to protect their eggs and newborn chicks. They do this thousands of times throughout the day.\n\nA study on the findings recently appeared in the publication Science.\n\nThe short “microsleeps” total around 11 hours each day. The microsleeps appear to be enough to keep the parents going for many weeks.\n\nNiels Rattenborg is a sleep researcher at the Max Planck Institute for Biological Intelligence in Germany. He helped write the new study. He said these penguins blink “… their eyes open and shut, and they do it 24/7 for several weeks at a time.”\n\n“What’s surprising is that they’re able to function okay and successfully raise their young,” he said.\n\nChinstrap penguins usually lay their eggs in November in nests made up of small rocks. As with many other kinds of penguins, mated pairs share parenting responsibilities. One parent usually watches the eggs and chicks alone while the other goes off fishing for family meals.\n\nAdult penguins do not face many natural predators in the mating season. But large birds called brown skuas eat the penguin eggs and small chicks. Other adult penguins may also try to steal the small rocks from nests. So, penguin parents must always be on guard.');
INSERT INTO `t_article_content` VALUES (3013, 3018, 'ing test flights on the Red Planet for the past two-and-a-half years. The experimental helicopter arrived on Mars along with NASA’s Perseverance explorer, or rover, in February 2021.\n\nBoth the rover and helicopter have been collecting images and data as they explore an area known as Jezero Crater. The goal of the exploration effort is to search for signs of ancient life on Mars.\n\nIngenuity made history on Mars\n\nIngenuity made history in April 2021 by becoming the first aircraft to complete a powered, controlled flight on another planet. NASA officials have said the helicopter has performed far above expectations. Agency engineers planned on Ingenuity completing just five experimental flights on Mars. But the helicopter has so far performed 66 flights. It has provided NASA with valuable data on building future aircraft to fly in space.\nTravis Brown is Ingenuity’s chief engineer at NASA’s Jet Propulsion Laboratory (JPL) in California. He said in a statement that with nearly every flight, the helicopter has progressed in new ways. Brown noted that over the past nine months, Ingenuity had doubled its top speed and height records. In addition, the aircraft’s operating speed and landings improved.\n\nMost Ingenuity flights only last two to three minutes. This is because the helicopter has energy and temperature limitations.\n\nNASA engineers say they have also been careful not to try to fly Ingenuity too fast because this can cause problems with its navigation system. The helicopter uses a camera to identify rocks and other things on the surface as it travels. If the aircraft goes too fast, it might not be able to navigate the best way forward.');
INSERT INTO `t_article_content` VALUES (3014, 3019, 'Countries are gathering for the 28th United Nations climate change conference in the United Arab Emirates at the end of November. Many will pay special attention to carbon capture to meet international commitments to decarbonize by mid-century.\n\nHere are some details about the carbon capture industry as well as some of the issues facing its future.\n\nDifferent kinds of carbon capture\n\nThere are two main kinds of carbon capture technology: carbon capture and storage (CCS) and carbon capture, utilization, and storage (CCUS).\n\nCCS, the most common form of carbon capture technology, involves capturing the gas from a source like an industrial smokestack. From there, the carbon can be moved directly to underground storage.\n\nCCUS involves capturing the gas and using it in another industrial activity before storage.\n\nThere are currently 42 CCS and CCUS projects across the world. The Global CCS Institute says these projects can store 49 million metric tons of carbon dioxide each year. That amount is about 0.13 percent of the world’s roughly 37 billion metric tons of yearly energy and industry-related carbon dioxide emissions.\n\nAnother form of carbon capture is direct air capture (DAC), in which carbon emissions are captured from the air.\n\nAbout 130 DAC facilities are being planned around the world, says the International Energy Agency (IEA).\n\nIn August, the United States announced $1.2 billion in financing for two DAC projects in the states of Texas and Louisiana that promise to capture 2 million metric tons of carbon per year. However, a final investment decision on the projects has not been made.');
INSERT INTO `t_article_content` VALUES (3015, 3020, 'Major automakers are seeking new ways to make electric vehicle (EV) motors that depend less on rare earth minerals.\n\nChina controls most mining and processing of a group of 17 metals known as rare earths. These minerals are used to produce permanent magnets. Many experts consider permanent magnets to be the most effective way to power EVs.\n\nBut new motor designs show that permanent magnets are not necessary to produce a commercially successfully EV. And some Western EV makers are finding new solutions to produce motors that avoid rare earth minerals.\n\nEV market leader Tesla announced earlier this year it planned to remove rare earths from its next-generation EVs.\n\nOther automakers are also in the process of researching or developing EV motors that use little or no rare earth minerals. These include General Motors, Jaguar Land Rover and BMW.\n\nNissan says it plans to develop newer motors with low rare earth content, as well as permanent magnet motors that will one day no longer need the minerals.\n\nGerman technology supplier ZF has developed a new kind of motor the company says is very similar to the size and performance of permanent magnet motors. This kind of motor, known as EESM, uses electricity to produce a magnetic field.\n\nZF’s Chief Technology Officer, Otmar Scharrer, told Reuters news agency such development is “an important contribution to making us a little more independent of China.”\n\nZF is in talks with U.S., European and Chinese automakers to supply the motor and could start producing EV models within two years, Scharrer said.\n\nBesides being mostly controlled by China, some rare earth development produces poisonous waste that can harm people and the environment. The problem could also be helped by using motors that do not depend on rare earth minerals.\n\n\"If you get it right, you\'ve got a much more sustainable product,\" said Ben Chiswick. He directs engineering business development for Detroit-based Drive System Design. The company is working to create rare earth-free motors with three different automakers.\n\nSome companies, like BMW, say they have already made great progress after years of research. \"It was not a home run... but it works very well without rare earths,\" said Uwe Deuke of BMW’s latest development efforts. He leads engineering efforts for the company’s EESM motor planned for its next-generation EVs.\n\nI’m Bryan Lynn.\n\nReuters reported this story. Bryan Lynn adapted the report for VOA Learning English.');
INSERT INTO `t_article_content` VALUES (3016, 3021, 'Artificial intelligence (AI) system developer OpenAI was under new leadership Monday after a series of recent changes that included the removal of former chief executive Sam Altman.\n\nOpenAI said on Friday it had dismissed Altman after a “breakdown of communications,” with the company’s board of directors, several news services reported. Altman’s “behavior and lack of transparency” had limited “the board’s ability to effectively supervise the company,” the New York Times reported a non-public company document as saying.\n\nOpenAI announced it had replaced Altman with Emmett Shear, a technology executive who formerly led live video gaming service Twitch.\n\nGreg Brockman, a president and co-founder of OpenAI, along with several company leaders, quit after Altman’s removal. Some wrote on X, \"OpenAI is nothing without its people.\"\n\nThe Associated Press reported that several hundred OpenAI employees also signed a letter calling for the board to step down and Altman to return.\n\nMicrosoft investment\n\nMicrosoft has invested billions of dollars in OpenAI in recent years. The company has supported the AI developer’s machine learning models with its knowledge and experience in building powerful computing machines. Both Microsoft chief Satya Nadella and OpenAI’s Shear said they remain committed to their existing business partnership.\n\nMicrosoft also announced on Monday that it had hired Altman, along with Brockman, to lead a new specialized AI research team at the company.\n\nNadella wrote on X that he was “extremely excited” to bring on the former executives of OpenAI and looked “forward to getting to know” Shear and the rest of the leadership team. Altman wrote on X, “the mission continues,” while Brockman promised, “We are going to build something new & it will be incredible.”\n\nAltman became the face of a new generation of AI systems, called chatbots, that have captured a flood of media attention in recent years. Chatbots are designed to interact smoothly with humans and perform high-level writing. The technology is also known as “generative AI.” The launch and widespread popularity of OpenAI’s ChatGPT tool started a wave of development in the field.\n\nIn a statement on X, Shear dismissed media reports suggesting Altman’s removal came because of disputes between top OpenAI leaders over the safety of the company’s AI methods. Shear promised to hire an independent investigator to look into what led to Altman’s ouster and offered to give a report within 30 days.\n\n“It’s clear that the process and communications around Sam’s removal has been handled very badly, which has seriously damaged our trust,” wrote Shear. He noted he also plans in the coming weeks to “reform the management and leadership team in light of recent departures into an effective force” and speak with employees, investors and users of OpenAI products.\n\nShear noted the reason behind the board removing Altman was not a “specific disagreement on safety.” Media reports have suggested disputes within OpenAI’s leadership about the company’s stated plans to safely build AI that is “generally smarter than humans.”\n\nOn a podcast in June, Shear said he is generally optimistic about technology. But he noted he has serious concerns about a possible path to create systems that are “a lot smarter than us” and could endanger humans.\n\nShear wrote that he had accepted the job “because I believe that OpenAI is one of the most important companies currently in existence.”\n\nRichard Windsor heads the British-based financial research company Radio Free Mobile. He told Reuters there had been conflicts between OpenAI’s mission to build technology to help people and that of its investors, who have expected a financial return on their investments in the company.\n\n\"This weekend was simply the detonation of a bomb that has been waiting to go off,\" Windsor said.\n\nI’m Bryan Lynn.\n\nThe Associated Press, Reuters and Agence France-Presse reported this story. Bryan Lynn adapted the reports for VOA Learning English.');
INSERT INTO `t_article_content` VALUES (3017, 3022, 'If humans are to establish long-term bases on the moon, they will need food resources.\n\nIn recent years, scientists have been taking steps toward making moon agriculture possible.\n\nResearchers in China said this month that they have found a way to turn soil, that is similar to lunar soil, fertile. They found that introducing special bacteria into the soil can increase the amount of phosphorus, an important nutrient for plants.\n\nThe Chinese scientists grew a plant that it is related to the tobacco plant in a laboratory in China. They used volcanic soil from the Changbai Mountains in Jilin province that is similar to moon soil, which scientists call lunar regolith. They treated the moon-like soil with three different kinds of bacteria. The researchers found that the plants raised in the bacteria-treated soil grew better than plants that grew in moon-like soil without the bacteria.\n\nThe researchers said the bacteria made the soil more acidic. This permitted phosphate from minerals to dissolve, making the nutrient available to the plants.\n\nResearcher Xia Yitong of the China Agricultural University in Beijing was the lead writer of the study published in Communications Biology. Xia said the importance of these findings is that scientists may be able to use the bacteria in lunar regolith to grow crops in future greenhouses on the moon.\n\nIn a study published last year, researchers in the United States grew a flowering plant called Arabidopsis thaliana in small containers. Each container had a gram of moon soil collected during the NASA missions to the moon more than 50 years ago.\n\nArabidopsis, also called thale cress, is a plant widely used in scientific research. In the earlier study, Arabidopsis did grow, but not as well in soil from the moon as it did in volcanic ash from Earth, which the researchers used for comparative purposes. Their study suggests that soil from the moon could become more fertile with improvements.\n\nThe new research involved benth, or Nicotiana benthamiana, another plant often used in research.\n\nIn the most recent study, the scientists said they used volcanic material from the Changbai mountains to create soil with similar chemical and physical properties to lunar regolith.\n\nThe names of the three bacteria used in the study are: Bacillus mucilaginosus, Bacillus megaterium and Pseudomonas fluorescens. The researchers tested other bacteria as well, but those did not produce the same effects.\n\nXia said carrying food, oxygen, and water to people on the moon would be too costly. Xia added, “A greenhouse for plant cultivation on the moon could greatly reduce the need of Earth-moon transportation.”\n\nA plant cultivation system on the moon could help meet long-term food and oxygen requirements for humans on the moon, Xia added. Plants produce oxygen from carbon dioxide in the process they use to create energy, called photosynthesis.\n\nXia said other plans to grow food on the moon that do not require soil are more costly because they require materials to be transported from Earth.\n\nXia said his team’s study met, “…the same goal [of plant cultivation] with much less consumption of carrying capability” compared to other plans.\n\nI’m Gregory Stachel.\n\nWill Dunham reported this story for Reuters. Gregory Stachel adapted it for VOA Learning English.');
INSERT INTO `t_article_content` VALUES (3018, 3023, 'Cheetahs usually hunt during the day. But the fast cats change their activity to early morning and early evening hours during warmer weather, a recent study says.\n\nThe time change sets the creatures up for more possible conflicts with competing predators - such as lions and leopards - that often hunt at night, say the study writers. Their research was published recently in Proceedings of the Royal Society B.\n\nBriana Abrahms of the University of Washington was a study co-writer. Abrahms said that changing temperatures can have an effect on \"the behavior .... of large carnivore species and also the dynamics among species.\"\n\nWhile cheetahs only eat fresh meat, lions and leopards will sometimes take food from smaller predators.\n\n“Lions and leopards normally kill prey themselves, but if they come across a cheetah’s kill, they will try to take it,” said Bettina Wachter of the Cheetah Research Project at the Leibniz Institute for Zoo and Wildlife Research.\n\n“The cheetahs will not fight the larger cats, they will just leave,” said Wachter, who was not involved in the study.\n\nHunting at different times of the day is one way to reduce meetings between the different predator species that share northern Botswana’s mixed grass and forest lands.\nBut the new study found that on the hottest days, when daily temperatures got to nearly 45 degrees Celsius, cheetahs became more active at night. This means cheetahs spent 16 percent more time hunting when other big cats hunt.\n\nKasim Rafiq of the University of Washington and the nonprofit Botswana Predator Conservation Trust was another co-writer of the study. Rafiq said about the shared hunting hours: “There’s a greater chance for more unfriendly encounters and less food for the cheetahs.\"\n\nFor the current study, researchers placed GPS devices on 53 large carnivores — including cheetahs, lions, leopards and African wild dogs. Researchers then recorded their positions and hours of activity over eight years. They compared this data with the highest daily temperature records.\n\nWhile seasonal differences explain most temperature changes in the time between 2011 to 2018, the scientists say the observed behavior changes offer information about the future of a warming world.\n\nIn future research, the scientists plan to use audio-recording devices and accelerometers — “like a Fitbit for big cats,” said Rafiq. The goal is to document the number of meetings between large meat-eating animals.\n\nIn addition to competition with lions and leopards, cheetahs already face strong pressure from the loss of living space and conflict with humans.\n\nThe fastest land animal, cheetahs are the rarest big cat in Africa, with fewer than 7,000 left in the wild.\n\n“These climate changes could become really critical if we look into the future — it’s predicted to become much warmer in this part of Africa where cheetahs live, in Botswana, Namibia and Zambia,” said Wachter of the Cheetah Research Project.\n\nI\'m John Russell.\n\nChristina Larson reported on this story for the Associated Press. John Russell adapted it for VOA Learning English.');
INSERT INTO `t_article_content` VALUES (3019, 3024, 'Our story today is called \"The Line of Least Resistance.” It was written by Edith Wharton. Here is Larry West with the story.\n\nMister Mindon returned home for lunch. His wife Millicent was not at home. The servants did not know where she was.\n\nMister Mindon sat alone at the table in the garden. He ate a small piece of meat and drank some mineral water. Mister Mindon always ate simple meals, because he had problems with his stomach. Why then did he keep a cook among his servants? Because his wife Millicent liked to invite her friends to big dinners and serve them rare and expensive food and wine.\n\nMister Mindon did not enjoy his wife\'s parties. Millicent complained that he did not know how to enjoy life. She did a lot of things that he did not like.\n\nMillicent wasted Mister Mindon\'s money and was unpleasant to him. But he never got angry with his wife.\n\nAfter eating, Mister Mindon took a walk through his house. He did not stay long in the living room. It reminded him of all the hours he had spent there at his wife\'s parties. The sight of the formal dining room made him feel even more uncomfortable. He remembered the long dinners where he had to talk to his wife\'s friends for hours. They never seemed very interested in what he was saying.\n\nMister Mindon walked quickly past the ballroom where his wife danced with her friends. He would go to bed after dinner. But he could hear the orchestra playing until three in the morning.\n\nMister Mindon walked into the library. No one in the house ever read any of the books. But Mister Mindon was proud to be rich enough to have a perfectly useless room in his house.\n\nHe went into the sunny little room where his wife planned her busy days and evenings. Her writing table was covered with notes and cards from all her friends. Her wastepaper basket was full of empty envelopes that had carried invitations to lunches, dinners, and theater parties.\n\nMister Mindon saw a letter crushed into a small ball on the floor. He bent to pick it up. Just as he was about to throw it into the wastepaper basket, he noticed that the letter was signed by his business partner, Thomas Antrim. But Antrim\'s letter to Mister Mindon\'s wife was not about business.\n\nAs Mister Mindon read it, he felt as if his mind was spinning out of control. He sat down heavily in the chair near his wife\'s little writing table.\n\nNow the room looked cold and unfamiliar. \"Who are you?\" the walls seemed to say. \"Who am I?\" Mister Mindon said in a loud voice. \"I\'ll tell you who I am! I am the man who paid for every piece of furniture in this room. If it were not for me and my money, this room would be empty!\" Suddenly, Mister Mindon felt taller. He marched across his wife\'s room. It belonged to him, didn\'t it? The house belonged to him, too. He felt powerful.\n\nHe sat at the table and wrote a letter to Millicent. One of the servants came into the room. \"Did you call, sir?\" he asked. \"No,\" Mister Mindon replied. \"But since you are here, please telephone for a taxi cab at once.\"\n\nThe taxi took him to a hotel near his bank. A clerk showed him to his room. It smelled of cheap soap. The window in the room was open and hot noises came up from the street. Mister Mindon looked at his watch. Four o\'clock. He wondered if Millicent had come home yet and read his letter.\n\nHis head began to ache, and Mister Mindon lay down on the bed. When he woke up, it was dark. He looked at his watch. Eight o\'clock. Millicent must be dressing for dinner. They were supposed to go to Missus Targe\'s house for dinner tonight. Well, Mister Mindon thought, Millicent would have to go alone. Maybe she would ask Thomas Antrim to take her to the party!\n\nMister Mindon realized he was hungry. He left his room and walked down the stairs to the hotel dining room. The air -- smelling of coffee and fried food -- wrapped itself around his head.\n\nMister Mindon could not eat much of the food that the hotel waiter brought him. He went back to his room, feeling sick. He also felt hot and dirty in the clothing he had worn all day. He had never realized how much he loved his home!\n\nSomeone knocked at his door. Mister Mindon jumped to his feet. \"Mindon?\" a voice asked. \"Are you there?\" Mister Mindon recognized that voice. It belonged to Laurence Meysy. Thirty years ago, Meysy had been very popular with women -- especially with other men\'s wives. As a young man he had interfered in many marriages. Now, in his old age, Laurence Meysy had become a kind of \"marriage doctor.” He helped husbands and wives save their marriages.\n\nMister Mindon began to feel better as soon as Laurence Meysy walked into his hotel room. Two men followed him. One was Mister Mindon\'s rich uncle, Ezra Brownrigg. The other was the Reverend Doctor Bonifant, the minister of Saint Luke\'s church where Mister Mindon and his family prayed every Sunday.\n\nMister Mindon looked at the three men and felt very proud that they had come to help him. For the first time in his married life, Mister Mindon felt as important as his wife Millicent.\n\nLaurence Meysy sat on the edge of the bed and lit a cigarette. \"Misses Mindon sent for me,\" he said. Mister Mindon could not help feeling proud of Millicent. She had done the right thing. Meysy continued. \"She showed me your letter. She asks you for mercy.\" Meysy paused, and then said: \"The poor woman is very unhappy. And we have come here to ask you what you plan to do.\"\n\nNow Mister Mindon began to feel uncomfortable. \"To do?\" he asked. \"To do? Well…I, I plan to…to leave her.\"\n\nMeysy stopped smoking his cigarette. \"Do you want to divorce her?\" he asked.\n\n\"Why, yes! Yes!\" Mister Mindon replied.\n\nMeysy knocked the ashes from his cigarette. \"Are you absolutely sure that you want to do this?\" he asked.\n\nMister Mindon nodded his head. \"I plan to divorce her,\" he said loudly.\n\nMister Mindon began to feel very excited. It was the first time he had ever had so many people sitting and listening to him. He told his audience everything, beginning with his discovery of his wife\'s love affair with his business partner, and ending with his complaints about her expensive dinner parties.\n\nHis uncle looked at his watch. Doctor Bonifant began to stare out of the hotel window. Meysy stood up. \"Do you plan to dishonor yourself then?\" he asked. \"No one knows what has happened. You are the only one who can reveal the secret. You will make yourself look foolish.”\n\nMister Mindon tried to rise. But he fell back weakly. The three men picked up their hats. In another moment, they would be gone. When they left, Mister Mindon would lose his audience, and his belief in himself and his decision. \"I won\'t leave for New York until tomorrow,\" he whispered. Laurence Meysy smiled.\n\n\"Tomorrow will be too late,\" he said. \"Tomorrow everyone will know you are here.\" Meysy opened the hotel room door. Mister Brownrigg and Doctor Bonifant walked out of the room.\n\nMeysy turned to follow them, when he felt Mister Mindon\'s hand grab his arm. \"I…I will come with you,\" Mister Mindon sighed. \"It\'s…it\'s…for the children.\" Laurence Meysy nodded as Mister Mindon walked out of the room. He closed the door gently.');
